INSERT INTO `oc_article_description` VALUES (5,10,'Summer House Guests - Featuring K250 Oasis Brewer','&lt;p&gt;Virtual reality and 3-D technology are already well-established in the entertainment industry. Now, the fashion industry is not-so-slowly adopting the same cutting-edge tech in its eternal quest for something new and different. Designer Iris van Herpen has long been experimenting with 3-D printing and Tommy Hilfiger introduced virtual reality headsets to his stores to let shoppers experience the runway show. Even Sephora has a new version of its app that allows you to “try on” makeup virtually.&lt;/p&gt;&lt;p&gt;Virtual reality and 3-D technology are already well-established in the entertainment industry. Now, the fashion industry is not-so-slowly adopting the same cutting-edge tech in its eternal quest for something new and different. Designer Iris van Herpen has long been experimenting with 3-D printing and Tommy Hilfiger introduced virtual reality headsets to his stores to let shoppers experience the runway show. Even Sephora has a new version of its app that allows you to “try on” makeup virtually.&lt;/p&gt;&lt;p&gt;Virtual reality and 3-D technology are already well-established in the entertainment industry. Now, the fashion industry is not-so-slowly adopting the same cutting-edge tech in its eternal quest for something new and different. Designer Iris van Herpen has long been experimenting with 3-D printing and Tommy Hilfiger introduced virtual reality headsets to his stores to let shoppers experience the runway show. Even Sephora has a new version of its app that allows you to “try on” makeup virtually.&lt;/p&gt;&lt;p&gt;Virtual reality and 3-D technology are already well-established in the entertainment industry. Now, the fashion industry is not-so-slowly adopting the same cutting-edge tech in its eternal quest for something new and different. Designer Iris van Herpen has long been experimenting with 3-D printing and Tommy Hilfiger introduced virtual reality headsets to his stores to let shoppers experience the runway show. Even Sephora has a new version of its app that allows you to “try on” makeup virtually.&lt;br&gt;&lt;/p&gt;','&lt;p&gt;We’re so excited! Our friend Kate from Domestikated Life  is back and sharing gorgeous photos...&lt;/p&gt;','post1','','','https://docs.google.com/forms/d/e/1FAIpQLSeyMeZ7Px8K6WaVFP1Auz-FtJx5GzKRSYnp8zGkWWAVStHFpg/viewform','2020-09-29 00:00:00','2020-10-02 00:00:00'),(6,10,'Summer House Guests - Featuring K250 Oasis Brewer','&lt;p&gt;Maria Denardo is the Fashion Director at theFashionSpot. Prior to joining tFS, she worked as the Site Director at Lifestyle Mirror and the Senior Fashion Editor at Fashion Week Daily. Her &quot;unhealthy attachment&quot; to hats led her to the halls of FIT, where she\'s currently completing her millinery certification. She proves that turbans never, ever go out of style.&lt;/p&gt;','&lt;p&gt;We’re so excited! Our friend Kate from Domestikated Life  is back and sharing gorgeous photos...&lt;/p&gt;','post2','','','','2020-08-14 00:00:00','2020-09-27 00:00:00'),(7,10,'EXPLORATION: THƯƠNG MẠI ĐIỆN TỬ ','&lt;p&gt;Hoạt động giáo dục trải nghiệm nghề nghiệp thực tế trên nền tảng Thương mại điện tử, đặc biệt dành riêng cho sinh viên khoa Công nghệ Thông tin Kinh doanh\r\nLà một sinh viên trong thời đại công nghệ luôn thay đổi, bạn có đang tìm kiếm một nơi mà ở đó, bạn vừa được học hỏi, cập nhật những kiến thức  mới, vừa nhận được cơ hội trải nghiệm một cách thực tế những gì đã học?\r\nNếu câu trả lời là có, thì “Exploration&quot; là chương trình dành riêng cho bạn.\r\n“Exploration” là một hoạt động giáo dục trải nghiệm đặc biệt do LCH SV khoa Công nghệ Thông tin Kinh doanh phối hợp với Câu lạc bộ Công nghệ kinh tế tổ chức. \r\n&lt;/p&gt;','&lt;p&gt;Hoạt động giáo dục trải nghiệm nghề nghiệp thực tế trên nền tảng Thương mại điện tử...&lt;/p&gt;','post3','','','','2020-09-28 00:00:00','2020-10-01 00:00:00'),(9,10,'MÀU CỦA UEH TRONG TÔI LÀ ...','&lt;div class=&quot;kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q&quot; style=&quot;overflow-wrap: break-word; margin: 0px; white-space: pre-wrap; font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;&quot;&gt;&lt;div dir=&quot;auto&quot; style=&quot;font-family: inherit;&quot;&gt;&lt;span class=&quot;pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu&quot; style=&quot;margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit;&quot;&gt;&lt;img height=&quot;16&quot; width=&quot;16&quot; alt=&quot;','&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;&quot;&gt;Chiến dịch tìm hiểu về Văn Hóa UEH đã trở lại với tiêu chí tạo môi trường lành mạnh giúp các bạn sinh viên chia sẻ tâm tư tình cảm trong suốt thời gian học tập tại Trường Đại học Kinh tế TP. Hồ Chí Minh. &lt;/span&gt;&lt;br&gt;&lt;/p&gt;','MÀU CỦA UEH TRONG TÔI LÀ ...','','','https://docs.google.com/forms/d/e/1FAIpQLSeyMeZ7Px8K6WaVFP1Auz-FtJx5GzKRSYnp8zGkWWAVStHFpg/viewform','2020-09-25 00:00:00','2020-10-02 00:00:00'),(10,10,'Kỹ năng Quản lý Tài chính 2020','&lt;p&gt;I. GIỚI THIỆU CHUNG&lt;/p&gt;&lt;p&gt;Kỹ năng Quản lý Tài chính là chương trình thường niên do Công Ty Visa kết hợp với Trung ương Hội Sinh viên Việt Nam tổ chức nhằm trang bị kiến thức và kỹ năng về tài chính dành cho sinh viên Việt Nam. Đặc biệt, Kỹ năng Quản lý Tài chính 2020 còn hứa hẹn mang đến nhiều điều thú vị khi lần đầu hướng tới sinh viên có ước mơ, dự định khởi nghiệp kinh doanh (startup).&lt;/p&gt;&lt;p&gt;Sinh viên thường có nhiều ý tưởng kinh doanh bay bổng, sáng tạo nhưng lại không biết phải bắt đầu từ đâu hoặc dễ thất bại vì thiếu đi kỹ năng quan trọng như quản lý tài chính. Những ý tưởng này giống như “phi thuyền” bay vô định trong “vũ trụ startup” mà không biết cách để “đáp đất”. Chương trình Kỹ năng Quản lý Tài chính 2020 với chủ đề “Vững tài chính, lái ý tưởng chạm đích” sẽ trang bị kiến thức và kỹ năng quản lý tài chính doanh nghiệp giúp sinh viên chạm tới ước mơ.&lt;/p&gt;&lt;p&gt;Chương trình sẽ giúp những “phi hành gia” của “phi thuyền startup&quot; này được thử nghiệm ý tưởng kinh doanh trong thực tế với nguồn kinh phí mà Visa tài trợ cùng tư vấn từ những chuyên gia dày dặn kinh nghiệm. Đặc biệt, thí sinh còn có cơ hội thực tập tại VinaCapital,&amp;nbsp; một trong những tập đoàn đầu tư và quản lý tài sản lớn nhất tại Việt Nam. Ngoài ra, các đội tham gia còn có cơ hội được cấp kinh phí lên đến 45.000.000 đồng để hiện thực hóa ý tưởng.&lt;/p&gt;&lt;p&gt;Mọi thông tin về chương trình được cập nhật tại website của chương trình: http://kynangquanlytaichinh2020.com/ và trang Facebook chương trình “Sinh viên với Kỹ năng Quản lý Tài chính”.&lt;/p&gt;','&lt;p&gt;Kỹ năng Quản lý Tài chính là chương trình thường niên do Công Ty Visa kết hợp với Trung ương Hội Sinh viên Việt Nam tổ chức nhằm trang bị kiến thức và kỹ năng về tài chính dành cho sinh viên Việt Nam.&amp;nbsp;&lt;br&gt;&lt;/p&gt;','Kỹ năng Quản lý Tài chính 2020','','','','2020-09-11 00:00:00','2020-10-11 00:00:00');
/*!40000 ALTER TABLE `oc_article_description` ENABLE KEYS */;
