INSERT INTO `oc_kb_mp_email_templates` VALUES (1,1,10,'Marketplace Seller Welcome','This template is used when a new customer registers as seller on the store. Note that the account is not yet approved due to which customer/seller has only limited access to the seller account.','&lt;div style=&quot;padding: 10px; border: 1px solid #000000;&quot;&gt;&lt;div style=&quot;margin-bottom: 30px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 18px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 27px; font-weight: 400; padding: 8px 0px 6px 0px;&quot;&gt;&lt;strong&gt;Marketplace Seller Welcome&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;p&gt;Thank You For Registering as Seller.&lt;/p&gt;&lt;p&gt;Your Email: {{email}}&lt;/p&gt;&lt;p&gt;Your Name: {{full_name}}&lt;/p&gt;&lt;p&gt;Once the Admin approves your seller account, you can start selling on our website.&lt;/p&gt;&lt;p style=&quot;margin-top: 30px; text-align: center;&quot;&gt;Please feel free to email us with any questions. If you prefer to call with any questions or requests we can be reached at: +91-999 999 XXXX&lt;/p&gt;&lt;p style=&quot;margin-top: 20px; text-align: center;&quot;&gt;Best Regards,&lt;/p&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 13px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 16px; padding: 5px 0px 3px 0px;&quot;&gt;&lt;strong&gt;Happy Shopping&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;table width=&quot;100%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot; style=&quot;background: #FFFFFF;&quot;&gt;&lt;tbody&gt;&lt;tr&gt;\r\n&lt;td align=&quot;center&quot; style=&quot;padding: 15px 50px 15px 50px;&quot;&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.facebook.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/fb.png&quot; alt=&quot;Facebook&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://tumblr.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/tumbler.png&quot; alt=&quot;Tumblr&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.pinterest.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/pin.png&quot; alt=&quot;Pinterest&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.twitter.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/twitter.png&quot; alt=&quot;Twitter&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;','2020-07-29 23:10:27','2020-08-10 11:16:13'),(2,2,10,' Đăng ký trở thành người bán thành công ','This template is used to notify the customer/seller about the approval of the seller account.','    &lt;div style=&quot;padding: 10px; border: 1px solid #000000;&quot;&gt;&lt;div style=&quot;margin-bottom: 30px; width: 100%; border: 1px solid #000000; background-color: #00abe0;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 18px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 27px; font-weight: 400; padding: 8px 0px 6px 0px;&quot;&gt;&lt;strong&gt;Bạn đã trở thành người bán trên Tabbook&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;p&gt;Chào {{full_name}},&lt;/p&gt;&lt;p&gt;Chúc mừng bạn đã trở thành người bán trên Tabbook, bạn có thể đăng bán sản phẩm ngay bây giờ.&lt;/p&gt;&lt;p&gt;Email của bạn: {{email}}&lt;/p&gt;&lt;p&gt;Tên của bạn: {{full_name}}&lt;/p&gt;&lt;p style=&quot;margin-top: 30px; text-align: center;&quot;&gt;Hãy liên hệ với chúng tôi nếu bạn có bất kỳ thắc mắc nào, liên hệ qua số điện thoại: +(84) 934 929 112&lt;/p&gt;&lt;p style=&quot;margin-top: 20px; text-align: center;&quot;&gt;Trân trọng, Tabbook&lt;/p&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%; border: 1px solid #000000; background-color: #00abe0;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 13px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 16px; padding: 5px 0px 3px 0px;&quot;&gt;&lt;strong&gt;Happy Shopping&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;table width=&quot;100%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot; style=&quot;background: #FFFFFF;&quot;&gt;&lt;tbody&gt;&lt;tr&gt;\r\n&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;    ','2020-07-29 23:10:27','2020-09-11 07:08:00'),(3,3,10,'Marketplace Seller Account Disapproved','This template is used to notify the customer/seller about the disapproval of the seller account request. The customer/seller can request for the account once again.','&lt;div style=&quot;padding: 10px; border: 1px solid #000000;&quot;&gt;&lt;div style=&quot;margin-bottom: 30px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 18px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 27px; font-weight: 400; padding: 8px 0px 6px 0px;&quot;&gt;Marketplace Seller Disapproved&lt;/p&gt;&lt;/div&gt;&lt;p&gt;Hi {{full_name}},&lt;/p&gt;&lt;p&gt;Sorry to inform you, Your seller account request is rejected on our website.&lt;/p&gt;&lt;p&gt;But do not worry you can request again for your account.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Reason for Disapproval:&lt;/b&gt;&lt;/p&gt;&lt;pre&gt;{{disapproval_reason}}&lt;/pre&gt;&lt;p style=&quot;margin-top: 30px; text-align: center;&quot;&gt;Please feel free to email us with any questions. If you prefer to call with any questions or requests we can be reached at: +91-999 999 XXXX&lt;/p&gt;&lt;p style=&quot;margin-top: 20px; text-align: center;&quot;&gt;Best Regards,&lt;/p&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 13px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 16px; padding: 5px 0px 3px 0px;&quot;&gt;&lt;strong&gt;Happy Shopping&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;table width=&quot;100%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot; style=&quot;background: #FFFFFF;&quot;&gt;&lt;tbody&gt;&lt;tr&gt;\r\n&lt;td align=&quot;center&quot; style=&quot;padding: 15px 50px 15px 50px;&quot;&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.facebook.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/fb.png&quot; alt=&quot;Facebook&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://tumblr.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/tumbler.png&quot; alt=&quot;Tumblr&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.pinterest.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/pin.png&quot; alt=&quot;Pinterest&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.twitter.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/twitter.png&quot; alt=&quot;Twitter&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;','2020-07-29 23:10:27','2020-08-10 11:16:13'),(4,4,10,'Marketplace Seller Registration Notification','This template is used to notify the admin about the new registration of a customer as seller. The admin has to approve the account request.','&lt;div style=&quot;padding: 10px; border: 1px solid #000000;&quot;&gt;&lt;div style=&quot;margin-bottom: 30px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 18px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 27px; font-weight: 400; padding: 8px 0px 6px 0px;&quot;&gt;Marketplace Seller Registration Notification&lt;/p&gt;&lt;/div&gt;&lt;p&gt;A customer just registered as seller on your website.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Details of the Customer are as follows: &lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Email: &lt;/b&gt;{{email}}&lt;/p&gt;&lt;p&gt;&lt;b&gt;Name:&lt;/b&gt; {{full_name}}&lt;/p&gt;&lt;p style=&quot;margin-top: 30px; text-align: center;&quot;&gt;Please feel free to email us with any questions. If you prefer to call with any questions or requests we can be reached at: +91-999 999 XXXX&lt;/p&gt;&lt;p style=&quot;margin-top: 20px; text-align: center;&quot;&gt;Best Regards,&lt;/p&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 13px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 16px; padding: 5px 0px 3px 0px;&quot;&gt;&lt;strong&gt;Happy Shopping&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;table width=&quot;100%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot; style=&quot;background: #FFFFFF;&quot;&gt;&lt;tbody&gt;&lt;tr&gt;\r\n&lt;td align=&quot;center&quot; style=&quot;padding: 15px 50px 15px 50px;&quot;&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.facebook.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/fb.png&quot; alt=&quot;Facebook&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://tumblr.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/tumbler.png&quot; alt=&quot;Tumblr&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.pinterest.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/pin.png&quot; alt=&quot;Pinterest&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.twitter.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/twitter.png&quot; alt=&quot;Twitter&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;','2020-07-29 23:10:27','2020-08-10 11:16:13'),(5,5,10,'Seller again Requested for Approving his Account','This template is used to notify the admin about request for approving account of a customer as seller after disapproving by admin.','&lt;p&gt;Hi Admin,&lt;/p&gt;&lt;div style=&quot;padding: 10px; border: 1px solid #000000;&quot;&gt;&lt;div style=&quot;margin-bottom: 30px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 18px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 27px; font-weight: 400; padding: 8px 0px 6px 0px;&quot;&gt;Customer has just requested for approving his seller account, after disapproved by you&lt;/p&gt;&lt;/div&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%;&quot;&gt;&lt;p style=&quot;text-decoration: underline; font-style: italic; font-size: 15px; font-weight: bold;&quot;&gt;Seller Details on Store:&lt;/p&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%;&quot;&gt;&lt;span&gt;&lt;b&gt;Store:&lt;/b&gt; {{shop_title}} &lt;/span&gt;&lt;br&gt;&lt;span&gt;&lt;b&gt;Name:&lt;/b&gt; {{seller_name}}&lt;/span&gt; &lt;br&gt;&lt;span&gt;&lt;b&gt;Email:&lt;/b&gt;{{seller_email}}&lt;/span&gt; &lt;br&gt;&lt;span&gt;&lt;b&gt;Contact:&lt;/b&gt; {{seller_contact}}&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;p style=&quot;margin-top: 30px; text-align: center;&quot;&gt;Please feel free to email us with any questions. If you prefer to call with any questions or requests we can be reached at: +91-999 999 XXXX&lt;/p&gt;&lt;p style=&quot;margin-top: 20px; text-align: center;&quot;&gt;Best Regards,&lt;/p&gt;&lt;div style=&quot;margin-bottom: 10px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 13px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 16px; padding: 5px 0px 3px 0px;&quot;&gt;&lt;strong&gt;Happy Shopping&lt;/strong&gt;&lt;/p&gt;&lt;/div&gt;&lt;table width=&quot;100%&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; border=&quot;0&quot; align=&quot;center&quot; style=&quot;background: #FFFFFF;&quot;&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td align=&quot;center&quot; style=&quot;padding: 15px 50px 15px 50px;&quot;&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.facebook.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/fb.png&quot; alt=&quot;Facebook&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://tumblr.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/tumbler.png&quot; alt=&quot;Tumblr&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.pinterest.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/pin.png&quot; alt=&quot;Pinterest&quot; width=&quot;37&quot;&gt; &lt;/a&gt;&lt;a style=&quot;border: none; padding-left: 10px; padding-right: 10px;&quot; href=&quot;https://www.twitter.com/&quot;&gt; &lt;img border=&quot;0&quot; src=&quot;http://tabbook.local/catalog/view/theme/default/image/kbmp_marketplace/twitter.png&quot; alt=&quot;Twitter&quot; width=&quot;37&quot;&gt;&lt;/a&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;/div&gt;','2020-07-29 23:10:27','2020-08-10 11:16:13'),(6,6,10,'New Product Approval Request','This template is used to notify the admin about the addition if a new product into the store by the respective seller. The admin needs to approve the product to make it visible in front.','&lt;div style=&quot;padding: 10px; border: 1px solid #000000;&quot;&gt;&lt;div style=&quot;margin-bottom: 30px; width: 100%; border: 1px solid #000000; background-color: #000;&quot;&gt;&lt;p style=&quot;color: #FFF; text-align: center; font-size: 18px; font-family: Open Sans, Arial, Helvetica, sans-serif; line-height: 27px; font-weight: 400; padding: 8px 0px 6px 0px;&quot;&gt;New product is just added to our store by &lt;b&gt;{{seller_title}}&lt;/b&gt;.&lt;/p&gt;&lt;/div&gt;&lt;br&gt;&lt;p&gt;&lt;b&gt;Product Details:&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;b&gt;Product Name:&lt;/b&gt; {{product_name}}&lt;/span&gt; &lt;br&gt;&lt;span&gt;&lt;b&gt;SKU:&lt;/b&gt;{{product_sku}}&lt;/