DROP TABLE IF EXISTS `oc_kb_mp_seller`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `oc_kb_mp_seller` (
  `seller_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `customer_id` int(11) unsigned DEFAULT NULL,
  `store_id` int(11) unsigned DEFAULT NULL,
  `approved` enum('0','1','2') NOT NULL DEFAULT '0' COMMENT '0 - Not Approved, 1 - Approved, 2 - Disapproved',
  `active` enum('0','1') NOT NULL DEFAULT '0' COMMENT '0 - Inactive, 1 - Active',
  `product_limit` tinyint(6) NOT NULL DEFAULT '0',
  `approval_request_limit` tinyint(6) NOT NULL DEFAULT '0',
  `phone_number` varchar(20) DEFAULT NULL,
  `business_email` varchar(255) DEFAULT NULL,
  `notification_type` enum('0','1','2') NOT NULL DEFAULT '1',
  `logo` varchar(255) DEFAULT NULL,
  `banner` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `state` int(11) unsigned NOT NULL,
  `country_id` int(11) unsigned DEFAULT NULL,
  `payout_type` enum('bankwire','paypal') DEFAULT NULL,
  `bankwire_account_info` varchar(255) DEFAULT NULL,
  `bankwire_bank_details` varchar(255) DEFAULT NULL,
  `bankwire_bank_address` varchar(255) DEFAULT NULL,
  `bankwire_additional_info` varchar(255) DEFAULT NULL,
  `paypal_id` varchar(255) DEFAULT NULL,
  `paypal_additional_info` varchar(255) DEFAULT NULL,
  `fb_link` varchar(255) DEFAULT NULL,
  `gplus_link` varchar(255) DEFAULT NULL,
  `twit_link` varchar(255) DEFAULT NULL,
  `disapprove_comment` varchar(255) DEFAULT NULL,
  `disapproval_count` int(10) NOT NULL,
  `deleted` tinyint(1) NOT NULL DEFAULT '0',
  `date_added` datetime NOT NULL,
  `date_updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`seller_id`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

