}\r\n                        });\r\n\r\n                        $(\'#product-category\').delegate(\'.fa-minus-circle\', \'click\', function() {\r\n                            $(this).parent().remove();\r\n                        });\r\n                    </script>\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        <file path=\"admin/controller/catalog/product.php\">\r\n                <operation error=\"log\">\r\n			<search><![CDATA[$this->model_catalog_product->editProduct($this->request->get[\'product_id\'], $this->request->post);]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n                        $this->load->language(\'kbmp_marketplace/common\');\r\n                        //Check if product is seller product and approved then allow to edit\r\n                        $sellerProduct = $this->model_kbmp_marketplace_kbmp_marketplace->isSellerProduct($this->request->get[\'product_id\']);\r\n                        if (isset($sellerProduct[\'approved\']) && $sellerProduct[\'approved\'] != \'1\') {\r\n                            $this->session->data[\'error\'] = $this->language->get(\'text_unapproved_product_edit_error\');\r\n\r\n                            if (isset($this->request->get[\'redirect\']) && !empty($this->request->get[\'redirect\'])) {\r\n                                $this->response->redirect($this->url->link(\'kbmp_marketplace/\'.$this->request->get[\'redirect\'], \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                            }\r\n                        } else if (isset($sellerProduct[\'seller_id\'])) {\r\n                            //Check if seller approved or not\r\n                            $sellerDetails = $this->model_kbmp_marketplace_kbmp_marketplace->getSellerAccountDetails($sellerProduct[\'seller_id\']);\r\n                            if (isset($sellerDetails[\'approved\']) && $sellerDetails[\'approved\'] != \'1\') {\r\n                                $this->session->data[\'error\'] = $this->language->get(\'text_unapproved_product_edit_error\');\r\n\r\n                                if (isset($this->request->get[\'redirect\']) && !empty($this->request->get[\'redirect\'])) {\r\n                                    $this->response->redirect($this->url->link(\'kbmp_marketplace/\'.$this->request->get[\'redirect\'], \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                                }\r\n                            }\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n                <operation error=\"log\">\r\n			<search><![CDATA[$data[\'action\']]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        if (isset($this->request->get[\'redirect\']) && !empty($this->request->get[\'redirect\'])) {\r\n                            $url .= \'&redirect=\' . $this->request->get[\'redirect\'];\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n		<!--start volyminhnhan@gmail.com - edit for P2P module with Koparion theme-->\r\n		<operation error=\"log\">\r\n			<search><![CDATA[protected function getList() {]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n                        if (isset($this->request->get[\'redirect\']) && $this->request->get[\'redirect\'] == \'products_list\') {\r\n                            $this->response->redirect($this->url->link(\'kbmp_marketplace/products_list\', \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                        } else if (isset($this->request->get[\'redirect\']) && $this->request->get[\'redirect\'] == \'products_approval_list\') {\r\n                            $this->response->redirect($this->url->link(\'kbmp_marketplace/products_approval_list\', \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n		<!--end volyminhnhan@gmail.com - edit for P2P module with Koparion theme-->\r\n		<operation error=\"log\">\r\n			<search><![CDATA[$this->response->redirect($this->url->link(\'catalog/product\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true));]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        if (isset($this->request->get[\'redirect\']) && $this->request->get[\'redirect\'] == \'products_list\') {\r\n                            $this->response->redirect($this->url->link(\'kbmp_marketplace/products_list\', \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                        } else if (isset($this->request->get[\'redirect\']) && $this->request->get[\'redirect\'] == \'products_approval_list\') {\r\n                            $this->response->redirect($this->url->link(\'kbmp_marketplace/products_approval_list\', \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        <file path=\"admin/controller/catalog/review.php\">\r\n                <operation error=\"log\">\r\n			<search><![CDATA[$data[\'action\']]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        if (isset($this->request->get[\'redirect\']) && !empty($this->request->get[\'redirect\'])) {\r\n                            $url .= \'&redirect=\' . $this->request->get[\'redirect\'];\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n		<operation error=\"log\">\r\n			<search><![CDATA[$this->response->redirect($this->url->link(\'catalog/review\', \'user_token=\' . $this->session->data[\'user_token\'] . $url, true));]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        if (isset($this->request->get[\'redirect\']) && $this->request->get[\'redirect\'] == \'products_review\') {\r\n                            $this->response->redirect($this->url->link(\'kbmp_marketplace/products_review\', \'user_token=\' . $this->session->data[\'user_token\'], true));\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        \r\n        <file path=\"system/engine/loader.php\">\r\n		<operation error=\"skip\">\r\n			<search><![CDATA[public function model($route) {]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n			public function adminmodel($model) {		\r\n                            $admin_dir = str_replace(\'system/\',\'admin/\', DIR_SYSTEM);\r\n                            $file = $admin_dir . \'model/\' . $model . \'.php\';		\r\n                            //$file  = DIR_APPLICATION . \'model/\' . $model . \'.php\';\r\n                            $class = \'Model\' . preg_replace(\'/[^a-zA-Z0-9]/\', \'\', $model);\r\n\r\n                            if (file_exists($file)) {\r\n                                include_once($file);\r\n\r\n                                $this->registry->set(\'model_\' . str_replace(\'/\', \'_\', $model), new $class($this->registry));\r\n                            } else {\r\n                                trigger_error(\'Error: Could not load model \' . $model . \'!\');\r\n                                exit();					\r\n                            }\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        <file path=\"catalog/controller/product/product.php\">\r\n                <operation error=\"log\">\r\n			<search><![CDATA[$this->model_catalog_product->updateViewed($this->request->get[\'product_id\']);]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n                        //Get Seller Information\r\n                        $this->document->addStyle(\'catalog/view/theme/default/stylesheet/kbmp_marketplace/product-page.css\');\r\n                        $this->load->language(\'kbmp_marketplace/common\');\r\n                        \r\n                        $data[\'text_sold_by\'] = $this->language->get(\'text_sold_by\');\r\n                        $data[\'text_view_reviews\'] = $this->language->get(\'text_view_reviews\');\r\n                        $data[\'text_write_review\'] = $this->language->get(\'text_write_review\');\r\n                        $data[\'text_more_seller_products\'] = $this->language->get(\'text_more_seller_products\');\r\n                        $data[\'text_total_seller_reviews\'] = $this->language->get(\'text_total_seller_reviews\');\r\n                        \r\n                        $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n                        $this->load->model(\'setting/kbmp_marketplace\');\r\n                            \r\n                        $store_id = (int) $this->config->get(\'config_store_id\');\r\n                        $settings = $this->model_setting_kbmp_marketplace->getSetting(\'kbmp_marketplace\', $store_id);\r\n                        $data[\'kbmp_marketplace_settings\'] = $settings;\r\n                            \r\n			//Start - Condition added to check if module is enabled - added on 15-Jan-2019 by Harsh\r\n                        if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) {\r\n		                if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_enable_seller_details\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_enable_seller_details\']) {\r\n		                    $seller_details = $this->model_kbmp_marketplace_kbmp_marketplace->getProductSeller($this->request->get[\'product_id\']);\r\n		                    if (isset($seller_details) && !empty($seller_details)) {\r\n		                        $data[\'seller_products_link\'] = $this->url->link(\'kbmp_marketplace/sellers/view\', \'&seller_id=\' . $seller_details[\'seller_id\']);\r\n\r\n		                        $data[\'seller_details\'] = $seller_details;\r\n		                        //Get Seller Reviews details\r\n		                        $seller_review_filter = array(\r\n		                            \'seller_id\' => $data[\'seller_details\'][\'seller_id\'],\r\n		                            \'filter_status\' => 1\r\n		                        );\r\n		                        $data[\'seller_total_reviews\'] = sprintf($data[\'text_total_seller_reviews\'], $this->model_kbmp_marketplace_kbmp_marketplace->getTotalSellerReviews($seller_review_filter));\r\n		                        $data[\'seller_rating\'] = $this->model_kbmp_marketplace_kbmp_marketplace->getSellerRating($seller_review_filter) * 20;\r\n		                        $data[\'seller_reviews_link\'] = $this->url->link(\'kbmp_marketplace/sellers/reviews\', \'&seller_id=\' . $data[\'seller_details\'][\'seller_id\']);\r\n		                    }\r\n		                }\r\n			}\r\n			//Ends\r\n			]]></add>\r\n		</operation>\r\n                <operation error=\"log\">\r\n			<search><![CDATA[$this->model_catalog_review->addReview($this->request->get[\'product_id\'], $this->request->post);]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n                        $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n                        $seller_details = $this->model_kbmp_marketplace_kbmp_marketplace->getProductSeller($this->request->get[\'product_id\']);\r\n                        if (isset($seller_details) && !empty($seller_details)) {\r\n                            $this->model_kbmp_marketplace_kbmp_marketplace->addSellerProductReview($this->request->get[\'product_id\'], $seller_details[\'seller_id\']);\r\n                        }\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        <file path=\"catalog/view/theme/*/template/product/product.twig\">\r\n		<operation error=\"log\">\r\n			<search><![CDATA[<div id=\"product\">]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        {% if (seller_details is defined and seller_details is not empty) %} \r\n                        <div id=\"kbmp-seller-info\" class=\"kbmp_block box-info-product\">\r\n                            <div class=\"kbmp_row\">\r\n                                <div class=\"kbmp_inner_block\"><span class=\"title\">{{ text_sold_by }}:</span></div>\r\n                                <div class=\"kbmp_inner_block\"><a href=\"{{ seller_products_link }}\"><span class=\"\">{{ seller_details[\'title\'] }}</span></a></div>\r\n                            </div>\r\n                            <div class=\"kbmp_row\">\r\n                                <div class=\"kbmp_inner_block\" style=\"position:relative;\">\r\n                                    <a href=\"\" title=\"\">\r\n                                    <div class=\"vss_seller_ratings\">\r\n                                        <div class=\"vss_rating_unfilled\">★★★★★</div>\r\n\r\n                                        <div class=\"vss_rating_filled\" style=\"width:{{ seller_rating }}%\">★★★★★</div>\r\n                                    </div>\r\n                                    </a>\r\n                                </div>\r\n                                <div class=\"kbmp_inner_block\"><a title=\"{{ seller_total_reviews }}\" href=\"{{ seller_reviews_link }}\" class=\"vss_active_link\"><i class=\"fa fa-book\"></i>&nbsp;&nbsp;{{ text_view_reviews }}</a></div>\r\n                                {% if (kbmp_marketplace_settings[\'kbmp_marketplace_setting\'][\'kbmp_enable_seller_review\'] is defined and kbmp_marketplace_settings[\'kbmp_marketplace_setting\'][\'kbmp_enable_seller_review\']) %} \r\n                                <div class=\"kbmp_inner_block\"><a href=\"{{ seller_reviews_link }}\" class=\"vss_active_link\"><i class=\"fa fa-pencil\"></i>&nbsp;&nbsp;{{ text_write_review }}</a></div>\r\n                                {% endif %} \r\n                            </div>\r\n                            <div class=\"kbmp_row\">\r\n                                <a href=\"{{ seller_products_link }}\" style=\"padding-left:2px; font-size:13px;\"><i class=\"fa fa-list-ul\"></i>&nbsp;&nbsp;{{ text_more_seller_products }}</a>\r\n                            </div>\r\n                        </div>\r\n                        <hr>\r\n                        {% endif %}\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        <file path=\"catalog/controller/checkout/shipping_method.php\">\r\n		<operation error=\"log\">\r\n			<search><![CDATA[foreach ($method_data as $key => $value) {]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n                        //Calculate Marketplace Shipping\r\n                        $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n                        \r\n			$this->load->model(\'setting/kbmp_marketplace\');\r\n                        //Get the module configuration values\r\n                        $store_id = (int) $this->config->get(\'config_store_id\');\r\n                        $settings = $this->model_setting_kbmp_marketplace->getSetting(\'kbmp_marketplace\', $store_id);\r\n                        \r\n                        //Start - Condition added to check if module is enabled - added on 15-Jan-2019 by Harsh\r\n                        if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) {\r\n		                $marketplace_quote = $this->model_kbmp_marketplace_kbmp_marketplace->getQuote($this->session->data[\'shipping_address\']);\r\n		                if ($marketplace_quote) {\r\n		                    $method_data[\'marketplace_custom_shipping\'] = array(\r\n		                        \'title\' => $marketplace_quote[\'title\'],\r\n		                        \'quote\' => $marketplace_quote[\'quote\'],\r\n		                        \'sort_order\' => $marketplace_quote[\'sort_order\'],\r\n		                        \'error\' => $marketplace_quote[\'error\']\r\n		                    );\r\n		                }\r\n			}\r\n                        //Ends\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n        <file path=\"catalog/model/checkout/order.php\">\r\n		<operation error=\"log\">\r\n			<search><![CDATA[$this->db->query(\"DELETE FROM \" . DB_PREFIX . \"order_product WHERE order_id = \'\" . (int)$order_id . \"\'\");]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n                        $this->db->query(\"DELETE FROM \" . DB_PREFIX . \"kb_mp_seller_order_detail WHERE order_id = \'\" . (int) $order_id . \"\'\");\r\n			]]></add>\r\n		</operation>\r\n		<operation error=\"log\">\r\n			<search><![CDATA[$order_product_id = $this->db->getLastId();]]></search>\r\n			<add position=\"after\"><![CDATA[\r\n                        //Add Order details in Knowband Marketplace Tables\r\n                        $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n\r\n			$this->load->model(\'setting/kbmp_marketplace\');\r\n                        //Get the module configuration values\r\n                        $store_id = (int) $this->config->get(\'config_store_id\');\r\n                        $settings = $this->model_setting_kbmp_marketplace->getSetting(\'kbmp_marketplace\', $store_id);\r\n                        \r\n                        //Start - Condition added to check if module is enabled - added on 15-Jan-2019 by Harsh\r\n                        if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) {\r\n		                if (isset($order_product_id) && !empty($order_product_id)) {\r\n		                    $kbmp_data = array(\r\n		                        \'order_id\' => (int) $order_id,\r\n		                        \'product_id\' => (int) $product[\'product_id\'],\r\n		                        \'order_detail_id\' => (int) $order_product_id,\r\n		                        \'unit_price\' => (float) $product[\'price\'],\r\n                                        \'tax\'  => $product[\'tax\'],\r\n		                        \'quantity\' => (int) $product[\'quantity\'],\r\n		                        \'is_consider\' => \'0\'\r\n		                    );\r\n		                    $this->model_kbmp_marketplace_kbmp_marketplace->addOrder($kbmp_data);\r\n		                }\r\n			}\r\n                        //Ends\r\n			]]></add>\r\n		</operation>\r\n                <operation error=\"log\">\r\n                    <search><![CDATA[return $order_id;]]></search>\r\n                    <add position=\"before\"><![CDATA[\r\n                    //Update Shipping value of Marketplace Orders\r\n                    $shipping_geo_zone_id = \'\';\r\n                    if (isset($data[\'shipping_code\'])) {\r\n                        if (strpos($data[\'shipping_code\'], \'marketplace_custom_shipping.marketplace_custom_shipping_\') !== false) {\r\n                            $shipping_geo_zone_id = str_replace(\"marketplace_custom_shipping.marketplace_custom_shipping_\", \"\", $data[\'shipping_code\']);\r\n\r\n                            $this->model_kbmp_marketplace_kbmp_marketplace->updateOrderShipping($order_id, $shipping_geo_zone_id);\r\n                        }\r\n                    }\r\n                    ]]></add>\r\n                </operation>\r\n                \r\n	</file>\r\n        <file path=\"catalog/controller/mail/order.php\">\r\n            <operation error=\"log\">\r\n                    <search><![CDATA[if (!$order_info[\'order_status_id\'] && $order_status_id) {]]></search>\r\n                    <add position=\"before\"><![CDATA[\r\n                    //Update value in Marketplace table to set is_consider bit against order id\r\n                    $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n                    $this->model_kbmp_marketplace_kbmp_marketplace->considerOrder($order_id);\r\n                    //Ends\r\n                    //code by gopi to send email for order cancel\r\n                    $this->load->model(\'setting/kbmp_marketplace\');\r\n                    //Get the module configuration values\r\n                    $store_id = (int) $this->config->get(\'config_store_id\');\r\n                    $settings = $this->model_setting_kbmp_marketplace->getSetting(\'kbmp_marketplace\', $store_id);  \r\n                    //Start - Condition added to check if module is enabled\r\n                    if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) {\r\n                        //check if send email in order cancel is active\r\n                        if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_email_on_cancel_order\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_email_on_cancel_order\']){  \r\n                            $cancel_order_satus = $settings[\'kbmp_marketplace_setting\'][\'cancel_order_status_value\'];\r\n                            $queryStatusName = $this->db->query(\"SELECT name FROM \" . DB_PREFIX . \"order_status WHERE order_status_id = \'\" . (int)$order_info[\'order_status_id\'] . \"\' AND language_id = \'\" . (int)$this->config->get(\'config_language_id\') . \"\'\");\r\n                            if (isset($cancel_order_satus) && isset($queryStatusName->row[\'name\']) && in_array($queryStatusName->row[\'name\'], $cancel_order_satus)){\r\n                               \r\n                                $sql = \"SELECT c.email FROM \" . DB_PREFIX . \"kb_mp_seller_order_detail ksod INNER JOIN \" . DB_PREFIX . \"kb_mp_seller ks ON (ksod.seller_id = ks.seller_id) INNER JOIN \" . DB_PREFIX . \"customer c ON (ks.customer_id = c.customer_id) WHERE ksod.order_id=\".$order_id;\r\n                                $seller_email = $this->db->query($sql);   \r\n                                $template = $settings[\'kbmp_marketplace_order_cancel_email_template\'][\'order_cancel_email_content_\'.$this->config->get(\'config_language_id\')];\r\n                                $emails =array_column($seller_email->rows,\'email\');\r\n                                foreach($emails as $email){\r\n                                    $this->model_setting_kbmp_marketplace->sendEmail($email,$order_id,$template);      \r\n                                }\r\n                            }\r\n                                \r\n                        }\r\n                    }\r\n		\r\n                 \r\n                    \r\n                        \r\n                        \r\n                    ]]></add>\r\n                </operation>\r\n                <operation error=\"log\">\r\n                    <search><![CDATA[\'name\'     => $order_product[\'name\'],]]></search>\r\n                    <add position=\"before\"><![CDATA[\r\n                    \'product_id\'     => $order_product[\'product_id\'],\r\n                    ]]></add>\r\n                </operation>\r\n                <operation error=\"log\">\r\n                    <search index=\"0\"><![CDATA[$mail->send();]]></search>\r\n                    <add position=\"after\"><![CDATA[\r\n                    //Seller Alert Mail\r\n                    if (isset($data[\'products\']) && !empty($data[\'products\'])) {\r\n                        $this->load->model(\'kbmp_marketplace/kbmp_marketplace\');\r\n                        foreach ($data[\'products\'] as $product) {\r\n                            $seller_details = $this->model_kbmp_marketplace_kbmp_marketplace->getProductSeller($product[\'product_id\']);\r\n                            if (isset($seller_details) && !empty($seller_details)) {\r\n                                $seller_for_mail[$seller_details[\'seller_id\']][\'products\'][] = $product;\r\n                            }\r\n                        }\r\n\r\n                        if (isset($seller_for_mail) && !empty($seller_for_mail)) {\r\n                            $this->load->model(\'setting/kbmp_marketplace\');\r\n                            $store_id = (int) $this->config->get(\'config_store_id\');\r\n                            $settings = $this->model_setting_kbmp_marketplace->getSetting(\'kbmp_marketplace\', $store_id);\r\n\r\n			    //Start - Condition added to check if module is enabled - added on 15-Jan-2019 by Harsh\r\n                            if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) && $settings[\'kbmp_marketplace_setting\'][\'kbmp_module_enable\']) {\r\n		                    foreach ($seller_for_mail as $key => $value) {\r\n		                        //Get Seller Configuration to overwrite default configuration if set exclusively for seller\r\n		                        $seller_config = $this->model_kbmp_marketplace_kbmp_marketplace->getSellerConfig($key, $store_id);\r\n		                        if (isset($seller_config) && !empty($seller_config)) {\r\n		                            foreach ($seller_config as $sellerconfig) {\r\n\r\n\r\n		                                $settings[\'kbmp_marketplace_setting\'][$sellerconfig[\'key\']] = $sellerconfig[\'value\'];\r\n		                            }\r\n		                        }\r\n		                        //Check if seller is allowed to get order email\r\n		                        if (isset($settings[\'kbmp_marketplace_setting\'][\'kbmp_email_on_new_order\']) && !empty($settings[\'kbmp_marketplace_setting\'][\'kbmp_email_on_new_order\'])) {\r\n		                            $this->load->model(\'account/customer\');\r\n		                            $seller_details = $this->model_kbmp_marketplace_kbmp_marketplace->getSellerAccountDetails($key);\r\n		                            $customer_details = $this->model_account_customer->getCustomer($order_info[\'customer_id\']);\r\n		                            $email_template = $this->model_kbmp_marketplace_kbmp_marketplace->getOrderEmailTemplate();\r\n		                            $this->load->language(\'kbmp_marketplace/common\');\r\n		                            \r\n		                            $text_kbmp_product = $this->language->get(\'text_kbmp_product\');\r\n		                            $text_kbmp_model = $this->