INSERT INTO `oc_product_description` VALUES (219,10,'Bí Quyết Để Chiến Thắng','&lt;p&gt;Với cách đặt vấn đề dễ hiểu, thiết thực và sâu sắc, YOU CAN WIN - Bí quyết của người chiến thắng sẽ giúp bạn tránh rơi vào cảm giác mất phương hướng, biết xác định mục tiêu và những giá trị ưu tiên trong cuộc sống.&lt;/p&gt;&lt;p&gt;&quot;Thành công không có nghĩa là không có thất bại, mà là đạt được mục tiêu cuối cùng: thắng lợi toàn cục, chứ không phải từng trận riêng lẻ.&quot; Edwin C.Bliss&lt;/p&gt;&lt;p&gt;Cuốn sách này sẽ giúp bạn rút ra cho mình những kinh nghiệm để chiến thắng thử thách và đi đến thành công.&lt;/p&gt;&lt;p&gt;Sách còn mới khoảng 70%.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Mình có thể giao hàng ở tất cả các cơ sở của UEH. Nhanh tay thực hiện thanh toán để thực hiện ngay nhé.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;','','bí quyết để chiến thắng','',''),(221,10,'Tôi Làm Việc Tôi Hạnh Phúc','&lt;p&gt;Sách còn mới 80%, bìa và các trang đều còn nguyên&lt;/p&gt;&lt;p&gt;Mình có thể giao hàng ở tất cả các cơ sở UEH.&lt;/p&gt;&lt;p&gt;Hãy thanh toán để giao dịch với mình nhé.&lt;/p&gt;','','tôi làm việc tôi hạnh phúc','',''),(222,10,'Hẹn Bạn Trên Đỉnh Thành Công','&lt;p&gt;Sách còn mới 80 - 90%, các trang và bìa sách còn y nguyên.&lt;/p&gt;&lt;p&gt;Cuốn sách rất hữu ích cho các bạn phấn đấu nỗ lực nhưng vẫn chưa thấy thành công, thành công là gì và làm thế nào để có được nó là những gì cuốn sách này có thể cho bạn biết.&lt;/p&gt;&lt;p&gt;Hãy nhanh tay thanh toán để liên hệ với mình nhé.&lt;/p&gt;&lt;p&gt;Mình có thể giao hàng ở cơ sở A và B của UEH thôi, vì mình đi xe bus nên hơi bất tiện cho việc giao sách.&lt;/p&gt;','','hẹn bạn trên đỉnh thành công','',''),(223,10,'Bí Quyết Tạo Dựng Cơ Nghiệp','&lt;p&gt;Là sinh viên không có nghĩa là chưa nghĩ đến việc xây dựng cơ nghiệp của mình. Nếu bạn đã nghĩ đến việc này và đang loay hoay nên làm thế nào và nên bắt đầu xây dựng từ đâu thì cuốn sách này có thể phần nào sẽ giúp bạn.&lt;/p&gt;&lt;p&gt;Sách tuy hơi cũ nhưng vẫn còn nguyên trang và chữ rõ ràng.&lt;/p&gt;&lt;p&gt;Mình sẵn sàng giao cho bạn ở các cơ sở UEH, thực hiện thanh toán để liên hệ với mình nhé.&lt;/p&gt;','','bí quyết tạo dựng cơ nghiệp','',''),(224,10,'Thay Thái Độ Đổi Cuộc Đời ','&lt;p&gt;Đọc cuốn sách này mình nhận ra thái độ quan trọng như thế nào trong cuộc sống và đặc biệt trong môi trường làm việc.&lt;/p&gt;&lt;p&gt;Sách này còn rất mới, mình đã đọc xong nên muốn nhượng lại để mua cuốn khác tiếp thu kiến thức mới :)&lt;/p&gt;&lt;p&gt;Mình có thể giao hàng cho bạn ở cơ sở nào của UEH cũng được&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;','','thay thái độ đổi cuộc đời','',''),(225,10,'Đắc Nhân Tâm Trong 90 Giây','&lt;p&gt;Sách tuy hơi cũ nhưng vẫn còn nguyên trang và chữ, nên bạn không cần phải lo về mặt chất lượng.&lt;/p&gt;&lt;p&gt;Mình có thể ship ở cơ sở A vì mình chỉ học ở đó và mình không có xe nên đi lại hơi bất tiện.&lt;/p&gt;','','Đắc Nhân Tâm Trong 90','',''),(226,10,'79 Nguyên Tắc Trong Giao Tiếp','&lt;p&gt;Giao tiếp tốt là một trong những chìa khoá dẫn đến thành công cho dù bạn là ai và làm việc trong lĩnh vực nào.&lt;/p&gt;&lt;p&gt;Sách còn mới mặc dù bìa hơi cũ&amp;nbsp;&lt;/p&gt;&lt;p&gt;Mình có thể giao hàng cho các bạn ở bất kì cơ sở nào của UEH.&lt;/p&gt;&lt;p&gt;Hãy thực hiện thanh toán để giao dịch với mình nhé.&lt;/p&gt;','','79 nguyên tắc trong giao tiếp','',''),(254,10,'QUẠT ĐIỆN CUTE 2in1','&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;� QUẠT ĐIỆN CUTE 2in1 � &lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;� #68k/em (giao mẫu ngẫu nhiên nhé) &lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;� Vừa là quạt � Vừa lại có đèn phát sáng&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Phí ship toàn quốc: 30k&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Freeship cho đơn hàng trên 300k (có thể mua thêm sp khác của shop để được freeship)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Có thể nhận hàng và thanh toán tại shop offline tại Phường 7, Quận 6 (shop sẽ gửi địa chỉ sau khi bạn order thành công trên Tabbook)&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','QUẠT ĐIỆN CUTE 2in1','',''),(239,10,'Giáo trình Thị trường chứng khoán (UEH)','&lt;p&gt;Sách photo mới 99%, chưa dùng lần nào.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Có thể nhận sách tại Viện đổi mới sáng tạo UEH.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Các bạn ở tỉnh hoặc nơi khác trong TP. HCM, mình có thể ship grab hoặc gửi bưu điện, phí ship do bạn chi trả.&amp;nbsp;&lt;/p&gt;','','Giáo trình Thị trường chứng khoán (UEH','',''),(240,10,'Quan trị học (Tóm tắt lý thuyết và câu hỏi trắc nghiệm)','&lt;p&gt;Giáo trình UEH&lt;/p&gt;&lt;p&gt;Sách photo mới 80% do mình có đánh trắc nghiệm khoảng 3 chương đầu tiên vào rồi.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Có thể nhận sách tại VIện đổi mới sáng tạo UEH.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Có thể chuyển ship cho các bạn, phí ship bạn chịu.&lt;/p&gt;','','Quan trị học (Tóm tắt lý thuyết và câu hỏi trắc nghiệm','',''),(251,10,'BÚT KIỂU TÍM XOÁ ĐƯỢC (Hộp 12 cái)','&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;� BÚT KIỂU TÍM XOÁ ĐƯỢC �&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt; �#43k/hộp/12c (giao mẫu nhiên được yêu cầu nam/nữ)&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Phí ship: 30k/nội thành HCM, mua trên 300k được freeship (có thể gom chung với nhiều món khác của shop để mua&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Có thể đến mua offline tại cửa hàng ở Phường 7, Quận 6. Địa chỉ sẽ được gửi đến bạn sau khi bạn order thành công.&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','BÚT KIỂU TÍM XOÁ ĐƯỢC (Hộp 12 cái','',''),(230,10,'Giáo trình thị trường chứng khoán','&lt;p&gt;&lt;span style=&quot;color: rgb(102, 102, 102); font-size: 16px;&quot;&gt;Sách còn mới khoảng 65-70%, bìa và các trang đều còn nguyên. Mình có thể giao hàng ở cở sở A và B của UEH. Mình có thể nhận tiền lúc đưa sách hoặc gửi tiền qua MoMo cho mình sau khi nhận sách nhé!&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','Giáo trình thị trường chứng khoán','',''),(231,10,'Văn hóa tổ chức và lãnh đạo','&lt;p&gt;&lt;span style=&quot;color: rgb(102, 102, 102); font-size: 16px;&quot;&gt;Sách còn mới 80%, bìa và các trang đều còn nguyên. Mình có thể giao hàng các cơ sở A và B của UEH.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','Văn hóa tổ chức và lãnh đạo','',''),(233,10,'Đường lối cách mạng của Đảng Cộng Sản VIệt Nam','&lt;p&gt;&lt;span style=&quot;color: rgb(102, 102, 102); font-size: 16px;&quot;&gt;Sách còn mới 70%, bìa và các trang đều còn nguyên. Mình có thể giao hàng ở cơ sở A và B của UEH. Hãy nhấn check out sách này và mình sẽ liên hệ để giao dịch với bạn nhé!&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','Đường lối cách mạng của Đảng Cộng Sản VIệt Nam','',''),(234,10,'Tài Liệu Hướng Dẫn Học Tập Những Nguyên Lý Cơ Bản Của CN Mác Lênin HP II','&lt;p&gt;Sách cũ, bị tróc một phần băng sính bìa sách (Không&amp;nbsp;ảnh hưởng tới nội dung) nhưng vẫn có thể sử dụng tốt cho việc học tập!&lt;/p&gt;','','Tài Liệu Hướng Dẫn Học Tập Những Nguyên Lý Cơ Bản Của CN Mác Lênin HP II','',''),(235,10,'Tài Liệu Hướng Dẫn Học Tập Những Nguyên Lý Cơ Bản Của CN Mác Lênin HP I','&lt;p&gt;Sách còn mới tinh, không rách&lt;/p&gt;','','Tài Liệu Hướng Dẫn Học Tập Những Nguyên Lý Cơ Bản Của CN Mác Lênin HP ','',''),(237,10,'Market Leader 1','&lt;p&gt;Sách còn mới,&amp;nbsp;đã qua sử dụng, có ghi chú trong sách khá nhiều!&lt;/p&gt;','','Market Leader ','',''),(238,10,'Bóng Rổ HP II','&lt;p&gt;Sách còn mới, không rách, dành cho bộ môn bóng rổ UEH (Học phần II)&lt;/p&gt;','','Bóng Rổ HP I','',''),(242,10,'Kinh Tế Vĩ Mô (giáo trình ĐH Mở)','&lt;p&gt;Giáo trình Kinh Tế Vĩ Mô, sách gốc, mới 70%, giáo trình của ĐH Mở.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Có thể nhận sách tại Viện đổi mới sáng tạo UEH.&lt;/p&gt;&lt;p&gt;Có thể ship cho bạn mua về tỉnh hoặc ở TP.HCM, phí ship do bạn mua trả.&lt;/p&gt;','','Kinh Tế Vĩ Mô (giáo trình ĐH Mở','',''),(243,10,'Giáo trình Tin học trong Kinh doanh','&lt;p&gt;Bạn vui lòng check out sản phẩm và mình sẽ liên hệ để trao đổi nha&lt;/p&gt;','','Giáo trình Tin học trong Kinh doanh','',''),(244,10,'Sách Bóng Đá Phần I + II (K43)','&lt;p&gt;&lt;span style=&quot;color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px; white-space: pre-wrap;&quot;&gt;Tài liệu giảng dạy môn Bóng đá (Học phần cơ bản + nâng cao). Check out mua sách để mình liên hệ nhé!&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','Sách Bóng Đá Phần I + II (K43)','',''),(236,10,'Đánh thức con người phi thường trong bạn','&lt;p&gt;Sách còn mới.&lt;/p&gt;&lt;p&gt;Nội dung sách rất cần thiết&amp;nbsp;để khám phá bản thân!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;','','Đánh thức con người phi thường trong bạn','',''),(245,10,'Sách Kinh Tế Chính Trị','&lt;p&gt;&lt;span style=&quot;color: rgb(32, 33, 36); font-family: Roboto, Arial, sans-serif; font-size: 14px; letter-spacing: 0.2px; white-space: pre-wrap;&quot;&gt;Sách còn mới 98% &lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','Sachs','',''),(246,10,'Kinh Tế Chính Trị ','&lt;p&gt;Sách còn mới 98%&lt;/p&gt;','','kinh te chinh tri','',''),(247,10,'test','&lt;p&gt;abc&lt;/p&gt;','','abc','',''),(250,10,'The  30-day Money Cleanse- Kỹ năng quản lý tài chính cá nhân trong 30 ngày','&lt;p&gt;Thông qua chương trình Thanh lọc Tài chính trong 30 ngày, cuốn sách The 30-day Money Cleanse sẽ định hình lại cách chi tiêu , thay đổi tư duy về tiền bạc và quản lý tài chính cá nhân hiệu quả&amp;nbsp; để hoàn thành các mục tiêu mà bạn mong muốn nhất trong đời.&lt;/p&gt;&lt;p&gt;Cuốn sách cung cấp các bước đầu tiên&amp;nbsp; vững chắc cho những người mới gia nhập lực lượng lao động hoặc bất cứ ai cần phát triển một thói quen tài chính tốt, quản lý tài chính hiệu quả và không còn sợ hãi khi đối mặt với vấn đề tài chính cá nhân.&lt;/p&gt;&lt;p&gt;_ Publishers Weely_&lt;/p&gt;','','The  30-day Money Cleanse- Kỹ năng quản lý tài chính cá nhân trong 30','',''),(252,10,'QUẠT ĐIỆN DORAEMON ĐÈN LED ','&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;� QUẠT ĐIỆN DORAEMON ĐÈN LED �&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Phí ship toàn quốc: 30k&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Freeship khi mua hóa đơn trên 300k ở shop (có thể mua thêm nhiều món khác ở shop để lấy freeship)&lt;br&gt;- Có thể mua offline tại shop ở Phường 7, Quận 6 (sau khi order thành công trên Tabbook shop sẽ gửi địa chỉ)&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','QUẠT ĐIỆN DORAEMON ĐÈN LED ','',''),(253,10,'QUẠT ĐIỆN TAI MICKEY','&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;QUẠT ĐIỆN TAI MICKEY có giá đỡ, có đèn 85k/1 cái ( màu ngẫu nhiên )&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Phí ship toàn quốc: 30k&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Freeship cho hóa đơn trên 300k (có thể mua thêm các sản phẩm khác tại shop để được freeship)&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px;&quot;&gt;- Có thể nhận hàng offline tại shop ở P7, quận 6 (sau khi khách order thành công trên Tabbook shop sẽ gửi địa chỉ)&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','QUẠT ĐIỆN TAI MICKEY','',''),(98,10,'Radiant Tees','&lt;p&gt;\r\n	Samsung Galaxy Tab 10.1, is the world&amp;rsquo;s thinnest tablet, measuring 8.6 mm thickness, running with Android 3.0 Honeycomb OS on a 1GHz dual-core Tegra 2 processor, similar to its younger brother Samsung Galaxy Tab 8.9.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Samsung Galaxy Tab 10.1 gives pure Android 3.0 experience, adding its new TouchWiz UX or TouchWiz 4.0 &amp;ndash; includes a live panel, which lets you to customize with different content, such as your pictures, bookmarks, and social feeds, sporting a 10.1 inches WXGA capacitive touch screen with 1280 x 800 pixels of resolution, equipped with 3 megapixel rear camera with LED flash and a 2 megapixel front camera, HSPA+ connectivity up to 21Mbps, 720p HD video recording capability, 1080p HD playback, DLNA support, Bluetooth 2.1, USB 2.0, gyroscope, Wi-Fi 802.11 a/b/g/n, micro-SD slot, 3.5mm headphone jack, and SIM slot, including the Samsung Stick &amp;ndash; a Bluetooth microphone that can be carried in a pocket like a pen and sound dock with powered subwoofer.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Samsung Galaxy Tab 10.1 will come in 16GB / 32GB / 64GB verities and pre-loaded with Social Hub, Reader&amp;rsquo;s Hub, Music Hub and Samsung Mini Apps Tray &amp;ndash; which gives you access to more commonly used apps to help ease multitasking and it is capable of Adobe Flash Player 10.2, powered by 6860mAh battery that gives you 10hours of video-playback time.&amp;nbsp;&amp;auml;&amp;ouml;&lt;/p&gt;\r\n','','Radiant Tees','',''),(255,10,'test','&lt;p&gt;test&lt;/p&gt;','','','',''),(256,10,'TEST ','&lt;p&gt;abc&lt;/p&gt;','','','',''),(257,10,'Sách Marketing - TABBOOK','&lt;p&gt;aaa&lt;/p&gt;','','','',''),(258,10,'Test Hoai 1','','','','','');
